import "./App.css";
import MainSection from "./components/MainSection";
import Gallery from "./components/Gallary";

function App() {
  return (
    <div className="App">
      <div className="blocks-container-main">
        <MainSection />
        <Gallery />
      </div>
    </div>
  );
}

export default App;
